import React from 'react';
import { Icon } from '@iconify/react';
// eslint-disable-next-line import/no-unresolved
import sportUtilityVehicle from '@iconify/icons-emojione-v1/sport-utility-vehicle';

const LocationMarker = ({ id }) => {
    return (
      <div className="location-market">
        <Icon icon={sportUtilityVehicle} className="location-icon" />
      </div>
    );
};

export default LocationMarker;
